import { Grid, Typography, Paper } from "@mui/material";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Outlet,
} from "react-router-dom";
import "./App.css";
import { useState } from "react";
import LoginRegister from "./components/LoginRegister";
import UserList from "./components/UserList";
import TopBar from "./components/TopBar";
import UserDetail from "./components/UserDetail";

const Layout = () => {
    return (
    <div>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <TopBar />
        </Grid>
        <div className="main-topbar-buffer" />
        <Grid item sm={3}>
          <Paper className="main-grid-item">
            <UserList />
          </Paper>
        </Grid>
        <Grid item sm={9}>
          <Paper className="main-grid-item">
            <Outlet />
          </Paper>
        </Grid>

        {/* <Grid>
          <Paper className="main-grid-item">
            <select key={""} value={""}>
              <option key={"My"} value={"My"}>My</option>
              <option key={"Tu"} value={"Tu"} >Tu</option>
              <option key={"Hi"} value={"Hi"} >Hi</option>
            </select>
          </Paper>
        </Grid> */}
      </Grid>
    </div>
  );
}

const App = (props) => {
    const [loginUser, setLoginUser] = useState(null);

    console.log(`user: ${loginUser._id}`);
    return (
        <Router>
          <Routes>
            <Route path="/" element={<Layout />}>
              <Route path="/users" element={<UserList loginUser={loginUser}/>}></Route>
              <Route path="/users/:userId" element={<UserDetail loginUser={loginUser} />} />
              <Route path="/login-register" element={<LoginRegister onLogin={setLoginUser} loginUser={loginUser} />} />
            </Route>
          </Routes>
        </Router>
    )
}

export default App;
